import React, { useState, useEffect } from 'react';
import { MapPin } from 'lucide-react';

// ... (keep the Countdown component unchanged)

const WeddingInvitation = () => {
  const [confirmed, setConfirmed] = useState(false);

  const CrucifixIcon = () => (
    <svg width="24" height="36" viewBox="0 0 24 36" className="inline-block">
      <path
        d="M10 2 L14 2 L14 8 L20 8 L20 12 L14 12 L14 34 L10 34 L10 12 L4 12 L4 8 L10 8 Z"
        fill="#666666"
        stroke="none"
      />
    </svg>
  );

  const Page = ({ children, className = "" }) => (
    <div className={`min-h-screen w-full flex items-center justify-center p-4 sm:p-8 relative bg-white ${className}`}>
      <div className="w-full max-w-md">
        {children}
      </div>
    </div>
  );

  const Timeline = () => {
    // ... (keep the Timeline component unchanged)
  };

  const SaveTheDatePage = () => (
    <div className="bg-white rounded-3xl overflow-hidden shadow-lg h-[600px] flex flex-col">
      <div className="p-8 flex-grow">
        <h1 className="text-4xl font-serif mb-4">SAVE</h1>
        <h1 className="text-4xl font-serif mb-1">THE <span className="font-script text-5xl">date</span></h1>
        <div className="mt-8 text-sm">
          <p>ADINA</p>
          <p>&</p>
          <p>MIHAI</p>
          <p className="mt-2">9.06.2025</p>
          <p>BUCHAREST, RO</p>
        </div>
      </div>
      <div className="h-64 bg-gray-200 overflow-hidden rounded-tl-3xl">
        <img src="m_a.jpg" alt="Adina and Mihai" className="w-full h-full object-cover object-right" />
      </div>
    </div>
  );

  const PageContent = ({ children, title }) => (
    <div className="bg-white rounded-3xl overflow-hidden shadow-lg h-[600px] p-8 flex flex-col">
      {title && <h2 className="text-2xl sm:text-3xl tracking-[0.2em] text-center mb-8">{title}</h2>}
      <div className="flex-grow overflow-auto">
        {children}
      </div>
    </div>
  );

  return (
    <div className="font-['Raleway'] min-h-screen flex flex-col">
      <Page>
        <SaveTheDatePage />
      </Page>

      <Page>
        <PageContent title="Program">
          <Timeline />
        </PageContent>
      </Page>

      <Page>
        <PageContent>
          <div className="text-center space-y-12 sm:space-y-16">
            <div>
              <h2 className="font-script text-3xl sm:text-4xl mb-6 sm:mb-8">Location</h2>
              <div className="space-y-4">
                <div className="flex items-center justify-center gap-2">
                  <MapPin className="w-5 h-5 sm:w-6 sm:h-6 text-gray-400" />
                  <span className="text-lg sm:text-xl">Банкетный зал "Нежность"</span>
                </div>
                <p className="text-gray-600 text-base sm:text-lg">ул. Свадебная, 1</p>
              </div>
            </div>

            <div className="pt-6 sm:pt-8">
              <h2 className="font-script text-3xl sm:text-4xl mb-6 sm:mb-8">Анкета гостя</h2>
              <p className="text-gray-600 text-base sm:text-lg mb-6 sm:mb-8">
                Будем сильно рады видеть вас на этом празднике жизни!
              </p>
              <button
                onClick={() => setConfirmed(!confirmed)}
                className={`px-8 sm:px-12 py-3 sm:py-4 rounded-md transition-all text-base sm:text-lg
                  ${confirmed 
                    ? 'bg-gray-200 text-gray-800' 
                    : 'bg-gray-800 text-white'
                  }`}
              >
                {confirmed ? 'Подтверждено' : 'Ответить'}
              </button>
            </div>
          </div>
        </PageContent>
      </Page>
    </div>
  );
};

const CustomStyles = () => {
  return (
    <style>{`
      @import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300;400;500&display=swap');
      @import url('https://fonts.googleapis.com/css2?family=Alex+Brush&display=swap');
      
      .font-script {
        font-family: 'Alex Brush', cursive;
      }
    `}</style>
  );
};

const WeddingInvitationWithStyles = () => (
  <div className="bg-gray-100 min-h-screen flex items-center justify-center">
    <div className="w-full max-w-[1000px] mx-auto relative z-10">
      <CustomStyles />
      <WeddingInvitation />
    </div>
  </div>
);

export default WeddingInvitationWithStyles;
